#include <string.h>

class Solution {
public:
   vector<int> findAnagrams(string s, string p) {
       
       vector<int> result;
       int i, start_index = 0, target_match_cnt = 0, match_cnt = 0;
       char front_c;

       int s_map[255]; init_array(s_map, 0, 255);
       int p_map[255]; init_array(p_map, 0, 255);

       string::iterator it, it_begin_substr;

       for(it = p.begin(); it != p.end(); ++it) //intialize p_map
           p_map[*it]++;        
       for(i = 0; i < 255; i++)                // initialize target_match_cnt
           target_match_cnt = target_match_cnt + p_map[i];
                                                                                                                            //initialize s_map
       for(it = s.begin(), i = 0; i < p.length() && it != s.end(); ++it, ++i){//initialize match_cnt
           s_map[*it]++;
           if(p_map[*it] != 0 && s_map[*it] <= p_map[*it])
               match_cnt++;
       }
   
       it_begin_substr = s.begin();

       if(match_cnt == target_match_cnt)
             result.push_back(start_index);
       if(p_map[*it_begin_substr] != 0 && s_map[*it_begin_substr] <= p_map[*it_begin_substr]) // <-- key!
             match_cnt--;
       
       s_map[*it_begin_substr]--;
       it_begin_substr++;
       start_index++; 

       for(; it != s.end(); ++it){ //traverse through the reset of s
           s_map[*it]++;
   
           if(p_map[*it] != 0 && s_map[*it] <= p_map[*it]) // <-- key!
                 match_cnt++;
           if(match_cnt == target_match_cnt)
                 result.push_back(start_index);
           if(p_map[*it_begin_substr] != 0 && s_map[*it_begin_substr] <= p_map[*it_begin_substr]) // <-- key!
                match_cnt--;
           
           s_map[*it_begin_substr]--;
           it_begin_substr++;
           start_index++; 
        } 

        return result;
   }
   void init_array(int* array, int val, int size){
           for(int i = 0; i < size; ++i, ++array)
                   *array = val;
   }
};



